import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from 'react-router-dom';
import { useState } from 'react';
import Login from '../src/user/login'
import Report from '../src/user/report'
import Reported from '../src/user/reported'
import Single from '../src/user/single'
import '@coreui/coreui/dist/css/coreui.min.css'
import 'bootstrap/dist/css/bootstrap.min.css'

function App() {
  return (
    <Router>
      <div className="App p-5 h-full" style={{background:"#C3EBF5",height:'100%'}}>
        <Routes>
          <Route path='/' element={< Login />}></Route>
          <Route path='/report' element={< Report />}></Route>
          <Route path='/reported' element={< Report />}></Route>
          <Route path='/single' element={< Report />}></Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
